package com.youku.player.decapi;

import android.content.Context;
import android.text.TextUtils;

public class DecApi {
    public static native String doDecNative(Context context, String str, int i);

    static {
        System.loadLibrary("decapi");
    }

    public static String getVideoInfo(Context context, String str) {
        return (TextUtils.isEmpty(str) || context == null) ? null : doDecNative(context, str, str.length());
    }

}
